import React from "react";

const Navbar = ({handleVerCarrito}) => {
    return (
        <header>
          <nav>
            <ul>
              <li onClick={handleVerCarrito}>Ver/Cerrar Carrito</li>
            </ul>
          </nav>
        </header>
      );
}

export default Navbar;
